import "./App.css";
import Home from "./Components/home";
import About from "./Components/about";
import Contact from "./Components/contact";
import Projects from "./Components/projects";
import Layout from "./Components/layout";
import {React} from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom";
// import {BrowserRouter, Routes, Route} from "react-router-dom";
//import { Tabs, Tab } from 'react-bootstrap';
import { DropdownButton, ButtonGroup, Dropdown } from 'react-bootstrap';


const App = () => {
   //const [key, setKey] = useState('home');
  return (
    <>
      <div>
      <h1>Test</h1>
        {['Info'].map(
          (variant) => (
            <DropdownButton
              as={ButtonGroup}
              key={variant}
              id={`dropdown-variants-${variant}`}
              variant={variant.toLowerCase()}
              title={variant}
              className="menuBar"
            >
              <BrowserRouter>
                <Routes>
                  <Route path="/" element={<Layout />}>
                    <Route index element={<Home />}>
                      <Dropdown.Item eventKey="home">Home</Dropdown.Item>
                    </Route>
                    <Route index element={<About />}>
                      <Dropdown.Item eventKey="about">About</Dropdown.Item>
                    </Route>
                    <Route index element={<Projects />}>
                      <Dropdown.Item eventKey="projects">Projects</Dropdown.Item>
                    </Route>
                    <Route index element={<Contact />}>
                      <Dropdown.Item eventKey="contact">Contact</Dropdown.Item>
                    </Route>
                    <>
                      <Dropdown.Divider />
                      <Dropdown.Item eventKey="resume">Resume</Dropdown.Item>
                    </>
                  </Route>
                </Routes>
              </BrowserRouter>
            </DropdownButton>
          ),
        )}
      </div>
    </>

